import React from 'react';
import {NavLink} from 'react-dom'
import about from './about'

function HomePage(props) {
    return (
        <div>
            <NavLink to='/about'>
                <text>Banking System</text>
            </NavLink>
        </div>
    );
}

export default HomePage;
